import React from 'react';


import SetingUpFrom from './components/SignUpForm';
const App = ()=>{
  return (
    <>

      <SetingUpFrom></SetingUpFrom>
      <Navbar />
      <Carousel />
      <CardItems />
      <HashRouter>
             <Switch>
              <Route exact path="/login" component={Login}/>
              <Route exact path="/register" component={Register}/>
             </Switch>
      </HashRouter>
    </>
  );

}

export default App;
